  `level` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '等级(1-5)A类白银 、(6-10)B类黄金、(11-15)C类钻石、(16-20)D类皇冠',
  `user_type` int(1) DEFAULT '0' COMMENT '用户所属:1、诊所中心 2、医院中心 3、物流中心',
  `is_login` int(1) DEFAULT '0' COMMENT '1:已登录，0：未登录',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=215 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户表';

-- ----------------------------
-- Records of base_user
