-- ----------------------------
-- Table structure for `fen_cash_account`
-- ----------------------------
DROP TABLE IF EXISTS `fen_cash_account`;
CREATE TABLE `fen_cash_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '账号id',
  `tx_uid` int(11) DEFAULT NULL COMMENT '提现帐户id（分销商id、诊所id、医院id）',
  `tx_type` int(1) DEFAULT NULL COMMENT '提现帐户类型:(1:分销商，2:诊所，3:医院)',
  `name` varchar(255) DEFAULT NULL COMMENT '收款人真实姓名',
  `account` varchar(255) DEFAULT NULL COMMENT '账户',
  `account_type` int(11) DEFAULT '0' COMMENT '账号类型：0支付宝 1微信 2银行卡',
  `account_bank` varchar(255) DEFAULT NULL COMMENT '所属银行及其支行',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `is_default` int(11) DEFAULT '0' COMMENT '是否设为默认账户 0 否  1 是',
  `addUid` int(11) DEFAULT NULL COMMENT '添加该记录的用户id',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of fen_cash_account
-- ----------------------------

-- ----------------------------
-- Table structure for `fen_cash_apply`
-- ----------------------------
DROP TABLE IF EXISTS `fen_cash_apply`;
CREATE TABLE `fen_cash_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `distributor_name` varchar(255) DEFAULT NULL COMMENT '提现申请人名称',
  `distributor_id` int(11) DEFAULT NULL COMMENT '提现申请人id',
  `total_money` float(12,2) DEFAULT '0.00' COMMENT '总佣金(可提)',
  `money` float(12,2) DEFAULT '0.00' COMMENT '提款金额',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `checker` varchar(255) DEFAULT NULL COMMENT '审核人账号',
  `account_id` int(11) DEFAULT NULL COMMENT '提现到的账户id',
  `check_time` varchar(255) DEFAULT NULL COMMENT '审核时间',
  `is_check` int(11) DEFAULT '0' COMMENT '0未审核1审核通过2审核不通过',
  `cash_static` int(11) DEFAULT '0' COMMENT '打款状态0未打款1即将打款2打款中3打款成功（4打款失败，再次打款，零钱状态下）',
  `error_info` varchar(255) DEFAULT NULL COMMENT '审核失败原因',
  `model` tinyint(3) DEFAULT '0' COMMENT '提现模式 1：红包提现，0：线下账号打款',
  `tx_uid` int(11) DEFAULT NULL COMMENT '提现用户id（分销商id、诊所id、医院id）',
  `tx_type` int(1) DEFAULT NULL COMMENT '提现用户类型:(1:分销商，2:诊所，3:医院)',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=177 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='提现申请';

-- ----------------------------
-- Records of fen_cash_apply
-- ----------------------------

-- ----------------------------
-- Table structure for `fen_cash_record`
-- ----------------------------
DROP TABLE IF EXISTS `fen_cash_record`;
CREATE TABLE `fen_cash_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '提现成功记录表',
  `distributor_name` varchar(255) DEFAULT NULL COMMENT '提现申请人名称',
  `distributor_id` int(11) DEFAULT NULL COMMENT '提现申请人id',
  `money` float(12,2) DEFAULT '0.00' COMMENT '金额',
  `checker` varchar(255) DEFAULT NULL COMMENT '审核人',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `tx_account_name` varchar(255) DEFAULT NULL COMMENT '被提现的账户名称(分销商名称、诊所名称、医院名称)',
  `tx_type` int(1) DEFAULT NULL COMMENT '被提现的账户类型:1:分销商，2：诊所，3:医院',
  `tx_uid` int(10) DEFAULT NULL COMMENT '被提现的账户id',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=74 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='佣金提现记录';

-- ----------------------------
-- Records of fen_cash_record
-- ----------------------------

