-- ----------------------------
-- Table structure for `fen_deal_goods`
-- ----------------------------
DROP TABLE IF EXISTS `fen_deal_goods`;
CREATE TABLE `fen_deal_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `drid` int(11) DEFAULT NULL COMMENT '交易记录id',
  `gid` int(11) DEFAULT NULL COMMENT '商品id',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `count` int(10) DEFAULT '0' COMMENT '商品数量',
  `thumb` varchar(255) DEFAULT NULL COMMENT '图片地址',
  `price` float(6,2) DEFAULT '0.00' COMMENT '交易单价',
  `module` varchar(255) DEFAULT NULL COMMENT '所属商城模块',
  `gpid` varchar(255) DEFAULT NULL COMMENT 'goods_property ID',
  `property` varchar(255) DEFAULT NULL COMMENT '属性',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1030 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='完成交易的商品';

-- ----------------------------
-- Records of fen_deal_goods
-- ----------------------------

-- ----------------------------
-- Table structure for `fen_deal_record`
-- ----------------------------
DROP TABLE IF EXISTS `fen_deal_record`;
CREATE TABLE `fen_deal_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单交易佣金表',
  `oid` int(11) DEFAULT NULL COMMENT '订单id',
  `order_num` varchar(50) DEFAULT NULL COMMENT '订单号',
  `total_price` float(12,2) DEFAULT '0.00' COMMENT '订单总额',
  `distributor_name` varchar(255) DEFAULT NULL COMMENT '分佣账户的名称(人、诊所、医院) （代理名称）',
  `distributor_id` int(11) DEFAULT NULL COMMENT '分佣账户的id(人、诊所、医院)（代理id）',
  `distributor_type` int(1) DEFAULT NULL COMMENT '分佣账户类型:1:分销商,2:诊所,3:医院 ，4：代理',
  `user_id` int(10) DEFAULT NULL COMMENT '用户id(诊所、医院显示处理该订单的操作人员的id)',
  `money` float(12,2) DEFAULT '0.00' COMMENT '分得的佣金',
  `add_time` varchar(255) DEFAULT NULL COMMENT '交易成功时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=391 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='交易记录';

-- ----------------------------
-- Records of fen_deal_record
-- ----------------------------

-- ----------------------------
-- Table structure for `fen_distributor`
-- ----------------------------
DROP TABLE IF EXISTS `fen_distributor`;
CREATE TABLE `fen_distributor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '分销商名称',
  `total_fee` float(12,2) DEFAULT '0.00' COMMENT '累计佣金',
  `my_fee` float(12,2) DEFAULT '0.00' COMMENT '可提现佣金',
  `fir_fee` float(12,2) DEFAULT '0.00' COMMENT '一级佣金',
  `sec_fee` float(12,2) DEFAULT '0.00' COMMENT '二级佣金',
  `phone` varchar(255) DEFAULT NULL COMMENT '手机号',
  `parent_id` int(11) DEFAULT '0' COMMENT '父级id（上级分销商id）',
  `grand_id` int(11) DEFAULT '0' COMMENT '祖父级id(上上级分销商id)',
  `grand_grand_id` int(11) DEFAULT '0' COMMENT '曾祖父级id',
  `rank` int(11) DEFAULT '1' COMMENT '级别',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `nick_name` varchar(255) DEFAULT NULL COMMENT '用户昵称',
  `head_img_url` varchar(255) DEFAULT NULL COMMENT '微信头像地址',
  `level` tinyint(1) DEFAULT '1' COMMENT '级别：0下线 1、分销商，2、中级分销商，3、高级分销商',
  `is_use` tinyint(3) DEFAULT '1' COMMENT '分销商 是否启用，停用则无法获取佣金',
  `freeze_fee` float(12,2) DEFAULT '0.00' COMMENT '冻结金额',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=188 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='分销商';

-- ----------------------------
-- Records of fen_distributor
-- ----------------------------

-- ----------------------------
-- Table structure for `fen_distributor_apply`
-- ----------------------------
DROP TABLE IF EXISTS `fen_distributor_apply`;
CREATE TABLE `fen_distributor_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '姓名',
  `phone` varchar(255) DEFAULT NULL COMMENT '手机号',
  `add_time` varchar(255) DEFAULT NULL COMMENT '申请时间',
  `check_time` varchar(255) DEFAULT NULL COMMENT '审核时间',
  `is_check` int(11) DEFAULT '0' COMMENT '0未审核1审核通过2审核不通过',
  `checker` varchar(255) DEFAULT NULL COMMENT '审核人账号',
  `parent_id` int(11) DEFAULT '0' COMMENT '父级id',
  `grand_id` int(11) DEFAULT '0' COMMENT '父级父级id',
  `rank` int(11) DEFAULT '1' COMMENT '级别',
  `sparetime` int(11) DEFAULT '0' COMMENT '业余时间0不太充足1较充足2充足',
  `friend_count` int(11) DEFAULT '0' COMMENT '朋友圈人数',
  `friend_type` varchar(255) DEFAULT '' COMMENT '朋友圈类型如白领、个体户等',
  `is_weixin_sale` int(11) DEFAULT '0' COMMENT '是否做个微信销售0否1是',
  `comment` varchar(255) DEFAULT NULL COMMENT '做过微信销售：做过哪些微信销售、业绩如何、经验教训',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `nick_name` varchar(255) DEFAULT NULL COMMENT '用户昵称',
  `head_img_url` varchar(255) DEFAULT NULL COMMENT '头像',
  `error_info` varchar(255) DEFAULT NULL COMMENT '审核不通过原因',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=81 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='分销商申请';

-- ----------------------------
-- Records of fen_distributor_apply
-- ----------------------------

-- ----------------------------
-- Table structure for `market_card`
-- ----------------------------
DROP TABLE IF EXISTS `market_card`;
CREATE TABLE `market_card` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(13) NOT NULL DEFAULT '' COMMENT '会员卡所属商家的名字',
  `address` text NOT NULL COMMENT '地址',
  `num_length` int(11) NOT NULL DEFAULT '0' COMMENT '卡编号的位数',
  `prefix` varchar(255) DEFAULT NULL COMMENT '卡编号前缀',
  `logo` varchar(255) DEFAULT NULL COMMENT '企业的logo',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `start_date` varchar(255) DEFAULT NULL COMMENT '开始日期',
  `end_date` varchar(255) DEFAULT NULL COMMENT '结束日期',
  `valid_start` varchar(255) DEFAULT NULL COMMENT '有效期起',
  `valid_end` varchar(255) DEFAULT NULL COMMENT '有效期止',
  `is_use` int(11) DEFAULT '1' COMMENT '启用停用1启用0停用',
  `notice` text COMMENT '使用须知',
  `phone` varchar(255) DEFAULT '' COMMENT '电话',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='会员卡';

-- ----------------------------
-- Records of market_card
-- ----------------------------

-- ----------------------------
-- Table structure for `market_card_level`
-- ----------------------------
DROP TABLE IF EXISTS `market_card_level`;
CREATE TABLE `market_card_level` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `card_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员卡id',
  `level` int(11) DEFAULT '1' COMMENT '1,2,3第n等级，1<2<3',
  `level_name` varchar(255) NOT NULL DEFAULT '' COMMENT '卡等级名称',
  `image` varchar(255) NOT NULL DEFAULT '' COMMENT '卡背景图片',
  `color` varchar(255) DEFAULT NULL COMMENT '颜色',
  `threshold` float(12,2) DEFAULT '0.00' COMMENT '升级阈值',
  `discount` varchar(11) DEFAULT '1' COMMENT '折扣 如七五折即：7.5',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='会员卡等级表';

-- ----------------------------
-- Records of market_card_level
-- ----------------------------

-- ----------------------------
-- Table structure for `market_card_user`
-- ----------------------------
DROP TABLE IF EXISTS `market_card_user`;
CREATE TABLE `market_card_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(25) NOT NULL DEFAULT '' COMMENT '用户id',
  `nick_name` varchar(255) DEFAULT NULL COMMENT '昵称',
  `card_id` int(11) DEFAULT NULL COMMENT '会员卡id',
  `card_name` varchar(13) NOT NULL DEFAULT '' COMMENT '卡名',
  `address` text NOT NULL COMMENT '地址',
  `logo` varchar(255) DEFAULT NULL COMMENT '企业的logo',
  `card_num` varchar(255) NOT NULL DEFAULT '' COMMENT '卡的数字编号',
  `valid_start` varchar(255) DEFAULT NULL COMMENT '有效期起',
  `valid_end` varchar(255) DEFAULT NULL COMMENT '有效期止',
  `level_id` int(11) NOT NULL DEFAULT '0' COMMENT '等级id',
  `level` int(11) DEFAULT '1' COMMENT '会员卡等级',
  `level_name` varchar(255) NOT NULL DEFAULT '' COMMENT '卡等级名称',
  `image` varchar(255) NOT NULL DEFAULT '' COMMENT '卡背景图片',
  `color` varchar(255) DEFAULT NULL COMMENT '颜色',
  `add_time` varchar(255) DEFAULT NULL COMMENT '领卡时间',
  `balance` float(12,2) DEFAULT '0.00' COMMENT '余额',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户会员卡';

-- ----------------------------
-- Records of market_card_user
-- ----------------------------

-- ----------------------------
-- Table structure for `market_config`
-- ----------------------------
DROP TABLE IF EXISTS `market_config`;
CREATE TABLE `market_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `label` varchar(255) DEFAULT NULL COMMENT '提示信息，显示标题名称',
  `item_key` varchar(80) DEFAULT '' COMMENT '英文别名，作为form标签的name名称',
  `item_value` text COMMENT '存储的值',
  `item_group` varchar(10) DEFAULT '' COMMENT '表单项类型',
  `tab` varchar(10) DEFAULT 'wechat' COMMENT 'form表单项类型，radio,text,textarea,select,richText富文本框',
  `sort` tinyint(3) unsigned DEFAULT '1' COMMENT '排序',
  `tip` varchar(255) DEFAULT NULL COMMENT '提示信息',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=80 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='互动营销配置表';

-- ----------------------------
-- Records of market_config
-- ----------------------------

-- ----------------------------
-- Table structure for `market_coupon`
-- ----------------------------
DROP TABLE IF EXISTS `market_coupon`;
CREATE TABLE `market_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '优惠券名称',
  `type` int(11) DEFAULT '1' COMMENT '优惠券类型 1：代金券，2、免费券，3、折扣券',
  `value` int(11) NOT NULL DEFAULT '0' COMMENT '优惠券面额',
  `condition_value` int(11) DEFAULT '0' COMMENT '满多少钱才能使用',
  `discount` varchar(255) DEFAULT NULL COMMENT '折扣值 如：8.8',
  `color` varchar(255) DEFAULT NULL COMMENT '颜色值',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '简单描述',
  `get_quantity` int(11) NOT NULL DEFAULT '0' COMMENT '已被领取的数量',
  `spare_quantity` int(11) NOT NULL DEFAULT '0' COMMENT '剩余数量',
  `user_limit` int(11) NOT NULL DEFAULT '1' COMMENT '单用户领取上限',
  `detail` varchar(255) DEFAULT NULL COMMENT '活动详情',
  `notice` text COMMENT '使用须知',
  `start_date` varchar(255) DEFAULT NULL COMMENT '活动开始日期',
  `end_date` varchar(255) NOT NULL DEFAULT '' COMMENT '活动结束过期日期',
  `add_time` varchar(255) NOT NULL DEFAULT '' COMMENT '添加时间',
  `is_use` int(11) NOT NULL DEFAULT '0' COMMENT '0开放优惠券1暂停优惠券',
  `use_scene` int(11) DEFAULT '0' COMMENT '使用场景：1线上、2线下、3不限',
  `share_times` int(11) DEFAULT '0' COMMENT '分享多少次可以获得优惠券一张 为0时不启用分享功能',
  `valid_start` varchar(255) DEFAULT NULL COMMENT '优惠券有效期起',
  `valid_end` varchar(255) DEFAULT NULL COMMENT '优惠券有效期止',
  `points` int(11) DEFAULT '0' COMMENT '优惠券积分',
  `use_type` int(11) DEFAULT '0' COMMENT '是否免费领取 ：0 免费领取 1：付费购买',
  `sale_value` float(12,2) DEFAULT '0.00' COMMENT '优惠券售价，无法免费领取',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='优惠券';

-- ----------------------------
-- Records of market_coupon
-- ----------------------------

-- ----------------------------
-- Table structure for `market_coupon_order`
-- ----------------------------
DROP TABLE IF EXISTS `market_coupon_order`;
CREATE TABLE `market_coupon_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `coupon_id` int(11) DEFAULT NULL COMMENT '优惠券id',
  `coupon_name` varchar(255) DEFAULT NULL COMMENT '优惠券名称',
  `coupon_info` text COMMENT '优惠券信息json格式',
  `points` int(11) DEFAULT '0' COMMENT '积分数',
  `message` varchar(255) DEFAULT NULL COMMENT '买家留言',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `nick_name` varchar(255) DEFAULT NULL COMMENT '用户昵称',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='积分兑换优惠券订单记录';

