  `nick_name` varchar(255) DEFAULT NULL COMMENT '用户名',
  `user_id` varchar(255) DEFAULT NULL COMMENT '用户id',
  `account` varchar(255) DEFAULT NULL COMMENT '用户账号',
  `order_name` varchar(255) DEFAULT NULL COMMENT '订单名称',
  `order_num` varchar(255) DEFAULT NULL COMMENT '订单编号',
  `order_desc` varchar(255) DEFAULT NULL COMMENT '订单描述',
  `couponInfo` text COMMENT '优惠券信息json格式',
  `coupon_num` int(11) DEFAULT '0' COMMENT '购买数量',
  `coupon_id` int(11) DEFAULT NULL COMMENT '优惠券id',
  `coupon_name` varchar(255) DEFAULT NULL COMMENT '优惠券名称',
