-- ----------------------------
-- Table structure for `plugin_sms`
-- ----------------------------
DROP TABLE IF EXISTS `plugin_sms`;
CREATE TABLE `plugin_sms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `count` varchar(255) DEFAULT '0' COMMENT '短信条数',
  `sid` varchar(255) DEFAULT NULL COMMENT '容联通讯主账号',
  `token` varchar(255) DEFAULT NULL COMMENT '容联通讯主账号token',
  `appid` varchar(255) DEFAULT NULL COMMENT '容联通讯云通讯应用id',
  `server_ip` varchar(255) DEFAULT NULL COMMENT '容联通讯云通讯服务ip',
  `server_port` varchar(255) DEFAULT NULL COMMENT '容联通讯云通讯服务端口',
  `server_soft_version` varchar(255) DEFAULT NULL COMMENT '容联通讯云通讯版本',
  `accessKeyId` varchar(255) DEFAULT NULL COMMENT '阿里云短信AccessKeyId',
  `accessKeySecret` varchar(255) DEFAULT NULL COMMENT '阿里云短信AccessKeySecret',
  `signName` varchar(255) DEFAULT NULL COMMENT '阿里云短信签名名称',
  `userid` varchar(255) DEFAULT NULL COMMENT '烽火云id',
  `account` varchar(255) DEFAULT NULL COMMENT '烽火云账号',
  `password` varchar(255) DEFAULT NULL COMMENT '烽火云密码',
  `plate` int(11) DEFAULT '0' COMMENT '短信发送平台 0 容联通讯 ，1 阿里云，2烽火云,',
  `is_use` int(11) DEFAULT '0' COMMENT '是否启用 0 停用 1启用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='短信信息表';

-- ----------------------------
-- Records of plugin_sms
-- ----------------------------

