-- Table structure for `plugin_sms_pay`
-- ----------------------------
DROP TABLE IF EXISTS `plugin_sms_pay`;
CREATE TABLE `plugin_sms_pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `count` int(11) DEFAULT '0' COMMENT '充值短信条数',
  `price` float(12,2) DEFAULT '0.00' COMMENT '价格',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='短信充值记录表';

-- ----------------------------
-- Records of plugin_sms_pay
-- ----------------------------

-- ----------------------------
-- Table structure for `plugin_sms_record`
-- ----------------------------
DROP TABLE IF EXISTS `plugin_sms_record`;
CREATE TABLE `plugin_sms_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) DEFAULT '0' COMMENT '类型0验证码1通知',
  `send_phone` varchar(255) DEFAULT NULL COMMENT '发送手机号',
  `verify_result` int(11) DEFAULT '0' COMMENT '验证结果0未验证1验证成功2验证失败',
  `send_ip` varchar(255) DEFAULT NULL COMMENT '用户ip',
  `content` varchar(255) DEFAULT '' COMMENT '短信内容',
  `add_time` varchar(255) DEFAULT NULL COMMENT '发送时间',
  `Code` varchar(255) DEFAULT NULL COMMENT '阿里云状态码-返回OK代表请求成功',
  `BizId` varchar(255) DEFAULT NULL COMMENT '阿里云	发送回执ID,可根据该ID查询具体的发送状态',
  `RequestId` varchar(255) DEFAULT NULL COMMENT '阿里云请求ID',
  `Message` varchar(255) DEFAULT NULL COMMENT '阿里云状态码的描述',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='短信发送记录表';

-- ----------------------------
-- Records of plugin_sms_record
-- ----------------------------

-- ----------------------------
-- Table structure for `plugin_sms_template`
-- ----------------------------
DROP TABLE IF EXISTS `plugin_sms_template`;
CREATE TABLE `plugin_sms_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(1) DEFAULT '0' COMMENT '0验证码,1通知',
  `template_id` varchar(255) DEFAULT NULL COMMENT '容联通讯云通讯短信模板id',
  `info` varchar(255) DEFAULT NULL COMMENT '容联通讯描述',
  `content` text COMMENT '容联通讯内容',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `templateCode` varchar(255) DEFAULT NULL COMMENT '阿里云短信短信模板Code',
  `templateParam` varchar(255) DEFAULT NULL COMMENT '阿里云短信模板字段名称，多个请用逗号分隔，如：尊敬的${user_name},你的验证码为${code}。将user_name,code,...',
  `templateCount` varchar(255) DEFAULT NULL COMMENT '模板内容',
  `plate` int(11) DEFAULT '0' COMMENT '短信发送平台 0 容联通讯 ，1 阿里云，2 腾讯云',
  `is_use` int(11) DEFAULT '0' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='客户短信配置表';

-- ----------------------------
-- Records of plugin_sms_template
-- ----------------------------

