  `price` float(12,2) DEFAULT '0.00' COMMENT '商品一般价格',
  `time_length` varchar(255) DEFAULT NULL COMMENT '时长',
  `apply` varchar(255) DEFAULT NULL COMMENT '适用内容',
  `sale_quantity` int(11) DEFAULT '0' COMMENT '商品销量',
  `creator` varchar(255) DEFAULT NULL COMMENT '创建人账号',
  `comment_count` int(11) DEFAULT '0' COMMENT '评价个数',
  `comment_score` float(5,2) DEFAULT '0.00' COMMENT '评价分数 分数 1-5 1差评，2、3中评，4、5好评',
  `points` int(11) DEFAULT '0' COMMENT '购买商品获得的积分',
  `recommend` int(11) DEFAULT '0' COMMENT '是否推荐 1：推荐，0：不推荐',
  `sort_num` int(11) DEFAULT '5' COMMENT '排序系数',
  `discount` varchar(10) DEFAULT NULL COMMENT '优惠比例',
  `ori_price` float(12,2) DEFAULT '0.00' COMMENT '原价',
  `sample_vessel` varchar(100) DEFAULT NULL COMMENT '采样容器',
  `inventory` int(11) DEFAULT '0' COMMENT '库存',
  `standard` int(11) DEFAULT '0' COMMENT '商品规格：0统一规格，1多规格',
  `tid` int(11) DEFAULT NULL COMMENT '模板id',
  `unit` varchar(20) DEFAULT NULL COMMENT '商品单位：件/斤/桶/箱/盒/罐',
  `updown_time` varchar(255) DEFAULT NULL COMMENT '上下架时间',
  `self_fee_ratio` float(12,2) DEFAULT '0.00' COMMENT '本级佣金系数',
  `parent_fee_ratio` float(12,2) DEFAULT '0.00' COMMENT '上级分销佣金系数',
  `grand_fee_ratio` float(12,2) DEFAULT '0.00' COMMENT '上上级分销佣金系数',
  `total_view` int(11) DEFAULT '0' COMMENT '浏览量',
  `price_tag` varchar(255) DEFAULT NULL COMMENT '价格描述',
  `pids` varchar(255) DEFAULT NULL COMMENT '商家承诺ids 1,2,12,',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品表';

-- ----------------------------
-- Records of store_goods
-- ----------------------------

