-- ----------------------------
DROP TABLE IF EXISTS `store_goods_image`;
CREATE TABLE `store_goods_image` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `gid` varchar(255) DEFAULT NULL COMMENT '商品id',
  `img_url` varchar(255) DEFAULT NULL COMMENT '辅图地址',
  `thumb` varchar(255) DEFAULT NULL COMMENT '缩率图地址',
