-- Table structure for `store_goods_property`
-- ----------------------------
DROP TABLE IF EXISTS `store_goods_property`;
CREATE TABLE `store_goods_property` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ori_price` float(12,2) DEFAULT '0.00' COMMENT '原价',
  `price` float(12,2) DEFAULT '0.00' COMMENT '绑定属性的商品价格',
  `inventory` int(11) DEFAULT '0' COMMENT '库存',
  `gid` int(11) DEFAULT NULL COMMENT 'goods表主键id',
  `property_json` varchar(255) DEFAULT '' COMMENT '属性的json形式，如[{name:''颜色'',value:''红色''},{name:''尺寸'',value:''1寸''}]',
  `property_text` varchar(255) DEFAULT '' COMMENT '属性的文本形式  颜色:红色,尺寸:1寸',
