-- ----------------------------
-- Table structure for `store_hospital`
-- ----------------------------
DROP TABLE IF EXISTS `store_hospital`;
CREATE TABLE `store_hospital` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(255) DEFAULT NULL COMMENT '医院名称',
  `address` varchar(255) DEFAULT NULL COMMENT '医院地址',
  `img_url` varchar(255) DEFAULT NULL COMMENT '图片地址',
  `thumb` varchar(255) DEFAULT NULL COMMENT '缩率图地址',
  `phone` varchar(30) DEFAULT '' COMMENT '医院电话',
  `add_time` varchar(255) DEFAULT NULL COMMENT '创建时间',
  `creator` varchar(255) DEFAULT NULL COMMENT '创建人账号',
  `detail_desc` varchar(255) DEFAULT NULL COMMENT '诊所描述',
  `longitude` varchar(30) DEFAULT NULL COMMENT '诊所位置经度',
  `latitude` varchar(30) DEFAULT NULL COMMENT '诊所位置纬度',
  `clinicId` varchar(20) DEFAULT NULL COMMENT '医院推荐ID',
  `hospital_ratio` varchar(10) DEFAULT NULL COMMENT '平台给医院的费用比例',
  `uid` varchar(255) DEFAULT NULL COMMENT '工作人员id(前端用户id)',
  `province` varchar(20) DEFAULT NULL COMMENT '省份',
  `city` varchar(20) DEFAULT NULL COMMENT '城市',
  `area` varchar(20) DEFAULT NULL COMMENT '区、县',
  `money` float(10,2) DEFAULT '0.00' COMMENT '可提现金额',
  `freeze_fee` float(10,2) DEFAULT '0.00' COMMENT '冻结金额(正在提现的金额)',
  `total_fee` float(10,2) DEFAULT '0.00' COMMENT '累计佣金',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=247 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品表';

