-- ----------------------------
-- Table structure for `store_label`
-- ----------------------------
DROP TABLE IF EXISTS `store_label`;
CREATE TABLE `store_label` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '标签名称，如最新商品或人气商品',
  `image` varchar(255) DEFAULT NULL COMMENT '标签图片地址',
  `thumb` varchar(255) DEFAULT NULL COMMENT '缩略图路径',
  `gids` text COMMENT '商品表主键，属于当前标签下的商品主键',
  `order_index` int(11) DEFAULT '5' COMMENT '标签前台页面展示排序系统，值越小越靠前',
  `ad_image` varchar(255) DEFAULT NULL COMMENT '广告图片',
  `link` varchar(255) DEFAULT NULL COMMENT '广告标签链接地址',
  `type` int(11) DEFAULT '0' COMMENT '0百货1订餐2旅游3酒店',
  `goods_num` varchar(255) DEFAULT NULL COMMENT '展示标签商品数量',
  `english_name` varchar(255) DEFAULT NULL COMMENT '英语标签',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品标签，如最新商品、推荐商品、人气商品';

