-- ----------------------------
-- Table structure for `store_order`
-- ----------------------------
DROP TABLE IF EXISTS `store_order`;
CREATE TABLE `store_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_num` varchar(255) DEFAULT NULL COMMENT '订单编号',
  `state` varchar(255) DEFAULT '0' COMMENT '订单状态：0待付款 1待采样 2待送检 3送检中 4检测中 5已完成',
  `goods_list` text COMMENT '商品信息json格式',
  `account` varchar(255) DEFAULT NULL COMMENT '用户账号(openId)',
  `nick_name` varchar(255) DEFAULT NULL COMMENT '用户昵称',
  `head_img_url` varchar(255) DEFAULT NULL COMMENT '微信头像',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机号',
  `total_price` float(12,2) DEFAULT '0.00' COMMENT '订单总额 实付款',
  `add_time` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `sample_time` varchar(30) DEFAULT NULL COMMENT '诊所采样时间',
  `check_time` varchar(30) DEFAULT NULL COMMENT '送检时间',
  `end_time` varchar(30) DEFAULT NULL COMMENT '订单完成时间',
  `pay_method` varchar(3) DEFAULT '0' COMMENT '支付方式 0未选择 1微信支付 2积分抵现 3货到付款 4余额支付',
  `transaction_id` varchar(255) DEFAULT NULL COMMENT '微信支付交易id',
  `pay_card` varchar(255) DEFAULT NULL COMMENT '支付的银行卡',
  `price_times` int(11) DEFAULT '0' COMMENT '价格变动次数',
  `checkMember_id` int(10) DEFAULT NULL COMMENT '体检人员id',
  `member_info` text COMMENT '体检人员信息',
  `clinicID` varchar(30) DEFAULT NULL COMMENT '诊所推荐ID',
  `clinic_id` int(10) DEFAULT NULL COMMENT '就诊诊所的id',
  `clinic_area` varchar(100) DEFAULT NULL COMMENT '诊所所在地',
  `clinic_worker` int(10) DEFAULT NULL COMMENT '诊所工作人员的用户id',
  `clinic_worker_name` varchar(100) DEFAULT NULL COMMENT '诊所工作人员名称',
  `hospital_id` int(10) DEFAULT NULL COMMENT '就诊医院的id',
  `hospital_worker` int(10) DEFAULT NULL COMMENT '医院核销人员的用户id',
  `hospital_worker_name` varchar(100) DEFAULT NULL COMMENT '医院工作人员名称',
  `logistics_worker` int(10) DEFAULT NULL COMMENT '物流中心物流人员用户id',
  `logistics_worker_name` varchar(100) DEFAULT NULL COMMENT '物流中心工作人员名称',
  `qr_code` text COMMENT '二维码',
  `is_show` int(1) DEFAULT '1' COMMENT '1:显示 0:删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户订单表';

-- ----------------------------
-- Records of store_order
-- ----------------------------

-- ----------------------------
-- Table structure for `store_order_goods`
-- ----------------------------
DROP TABLE IF EXISTS `store_order_goods`;
CREATE TABLE `store_order_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `oid` int(11) DEFAULT NULL COMMENT '订单id',
  `gid` int(11) DEFAULT NULL COMMENT '商品id',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `count` int(10) DEFAULT '0' COMMENT '商品数量',
  `thumb` varchar(255) DEFAULT NULL COMMENT '图片地址',
  `price` float(12,2) DEFAULT '0.00' COMMENT '现在价格',
  `clinic_id` int(10) DEFAULT NULL COMMENT '就诊诊所的id',
  `hospital_id` int(10) DEFAULT NULL COMMENT '就诊医院的id',
  `hospital_worker` int(10) DEFAULT NULL COMMENT '医院核销人员的id',
  `logistics_id` int(10) DEFAULT NULL COMMENT '物流中心id',
  `logistics_worker` int(10) DEFAULT NULL COMMENT '物流中心物流人员id',
  `state` int(1) DEFAULT '0' COMMENT '订单商品状态：0待付款 1待采样 2待送检 3送检中 4检测中 5已完成',
  `qr_code` text COMMENT '二维码',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=80 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='定单商品表';

