-- Records of weixin_config
-- ----------------------------

-- ----------------------------
-- Table structure for `weixin_eventkey`
-- ----------------------------
DROP TABLE IF EXISTS `weixin_eventkey`;
CREATE TABLE `weixin_eventkey` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `eventkey` varchar(255) DEFAULT NULL COMMENT '事件名称',
  `url` varchar(255) DEFAULT NULL COMMENT '链接地址',
  `content` varchar(255) DEFAULT NULL COMMENT '内容',
  `type` int(11) DEFAULT '0' COMMENT '是否是纯文字 0 否 1是',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信点击事件';

-- ----------------------------
-- Records of weixin_eventkey
-- ----------------------------

-- ----------------------------
-- Table structure for `weixin_message`
-- ----------------------------
DROP TABLE IF EXISTS `weixin_message`;
CREATE TABLE `weixin_message` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT,
  `content` text COMMENT '文字内容（当类型是my_news时，为itemList的json格式）',
  `media_id` varchar(255) DEFAULT '' COMMENT '媒体id',
  `type` varchar(255) DEFAULT 'text' COMMENT '消息类型：text文字，image图片，news图文连接，voice音频，vedio视频，my_news自定义图文',
  `url` varchar(255) DEFAULT '' COMMENT '图文链接地址',
  `add_time` varchar(255) DEFAULT '' COMMENT '添加时间',
  `use_scene` int(11) DEFAULT '0' COMMENT '使用场景:0关注自动回复,1统一回复（设置自动回复后消息不在转发给多客服）,2关键词自动回复3事件回复',
  `is_use` int(11) DEFAULT '1' COMMENT '0,1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信消息';

-- ----------------------------
-- Records of weixin_message
-- ----------------------------

-- ----------------------------
-- Table structure for `weixin_rule`
-- ----------------------------
DROP TABLE IF EXISTS `weixin_rule`;
CREATE TABLE `weixin_rule` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rule_name` varchar(255) DEFAULT NULL COMMENT '规则名',
  `keywords` varchar(255) DEFAULT NULL COMMENT '关键词规则如：你好|hello|您好|,以|隔开',
  `message_id` varchar(255) DEFAULT NULL COMMENT '消息id',
  `add_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `is_use` int(11) DEFAULT '1' COMMENT '0,1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='关键词自动回复规则';

-- ----------------------------
-- Records of weixin_rule
-- ----------------------------
